import './App.css';
import React from 'react';
import { Container } from 'semantic-ui-react';

import TableTemplate from './tableTemplate';

class LeagueTable extends React.Component {
    state = { table: [] }

    render() {
        return (
            <Container className="App">
                <TableTemplate/>
            </Container>
        );
    }
}

export default LeagueTable;
